sys_variable_value.value:
(function execute(inputs, outputs) {
  var xmlDoc = new XMLDocument2();
  xmlDoc.setNamespaceAware(true);
  xmlDoc.parseXML(inputs.response_body);
  var temp = gs.xmlToJSON(xmlDoc.getDocumentElement());
  if (inputs.status == 200) {
    outputs.status = "Success";
    var contents = temp.CreateLoadBalancerResponse.CreateLoadBalancerResult.LoadBalancers.member;
    outputs.load_balancer_arn = contents.LoadBalancerArn
    outputs.dns_name = contents.DNSName
    outputs.canonical_hosted_zone_id = contents.CanonicalHostedZoneId
    outputs.state = contents.State.Code
    outputs.created_time = contents.CreatedTime
  } else {
    outputs.status = "Error";
    outputs.error_message = temp.ErrorResponse.Error.Message;
  }
})(inputs, outputs);

